            ]
    }

    render() {

        return (
            <div className="list-group">
                <div className="languages">
                    <div className="languages">

                        {this.state.languages.map(language => <Element language={language} incrementCount={this.incrementCount}/>  )}



                    </div>
                </div>
            </div>
        )







    }




}
